    <BrowserRouter>
      <Routes>
        <Route path='/' element={<App />} />
        <Route path='/connexion' element={<Connexion />} />
        <Route path='/Sign-in' element={<SignIn />} />
        <Route path='/create-post' element={<CreatePost />} />
        <Route path='/posts/:id' element={<FullPost />} />
      </Routes>
    </BrowserRouter>
  </UserContext.Provider>
);
